"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Pericarditis in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pericarditis-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H101390544\">",
"      <span class=\"h1\">",
"       What is pericarditis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pericarditis is a condition that causes irritation of the tissue around the heart. This tissue (called the &ldquo;pericardium&rdquo;) forms a sac that protects the heart and keeps it from rubbing against other nearby organs (",
"      <a class=\"graphic graphic_figure graphicRef69323 \" href=\"UTD.htm?0/27/432\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Pericarditis is rare in children. Children who have certain medical conditions have a higher risk of getting it. These conditions include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An infection with a virus",
"       </li>",
"       <li>",
"        A disease called &ldquo;lupus&rdquo; &ndash; In this disease, the body&rsquo;s infection-fighting system, called the &ldquo;immune system,&rdquo; attacks the body&rsquo;s own healthy tissues.",
"       </li>",
"       <li>",
"        Surgery for a heart condition the child was born with &ndash; Fluid sometimes builds up around the heart after surgery. This can cause pericarditis.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H101390559\">",
"      <span class=\"h1\">",
"       What are the symptoms of pericarditis in children?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Chest pain",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Feeling weak or tired",
"       </li>",
"       <li>",
"        Having trouble breathing",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Chest pain is the most common symptom of pericarditis. It can be a sharp pain or a dull ache. Your child might have pain in the front of the chest, the shoulder, or the upper back.",
"     </p>",
"     <p>",
"      If your child has sharp chest pain, it might get worse when he or she takes a deep breath. If the pain is a dull ache, it might get better when your child sits up and leans forward.",
"     </p>",
"     <p>",
"      Many other conditions can cause chest pain and fever in children. Because pericarditis is rare, a different condition could be causing these symptoms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H101390574\">",
"      <span class=\"h1\">",
"       Should my child see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Take your child to the doctor or nurse if he or she:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Has chest pain",
"       </li>",
"       <li>",
"        Is a baby, and gets sweaty when breastfeeding or bottle feeding",
"       </li>",
"       <li>",
"        Has trouble breathing",
"       </li>",
"       <li>",
"        Has swelling in the legs or other parts of the body",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H101390591\">",
"      <span class=\"h1\">",
"       Will my child need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor or nurse will do an exam and ask about your child&rsquo;s symptoms. He or she can do one or more of these tests: &nbsp;",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An electrocardiogram (ECG or EKG)&nbsp;&mdash; This test measures the electrical activity in your child&rsquo;s heart.",
"       </li>",
"       <li>",
"        An echocardiogram&nbsp;&ndash; This test uses sound waves to create a picture of your child&rsquo;s heart as it beats. &nbsp;",
"       </li>",
"       <li>",
"        A chest X-ray &ndash; This test can show if there is a large amount of fluid around your child&rsquo;s heart. &nbsp;",
"       </li>",
"       <li>",
"        Blood tests&nbsp;&mdash; These measure the levels of certain proteins in the blood. The protein levels are a clue to the health of your child&rsquo;s heart. They can also tell the doctor if your child has a disease that is causing the pericarditis, and if the pericarditis is improving.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H101390608\">",
"      <span class=\"h1\">",
"       How is pericarditis in children treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatments for pericarditis in children depend on the cause. Treatments might include: &nbsp;",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines to reduce pain and inflammation, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?6/12/6342?source=see_link\">",
"         aspirin",
"        </a>",
"        ,",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        &nbsp;(sample brand names: Advil&reg;, Motrin&reg;), or",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?0/34/550?source=see_link\">",
"         indomethacin",
"        </a>",
"        &nbsp;(brand name: Indocin&reg;)",
"       </li>",
"       <li>",
"        Steroid medicines to reduce inflammation (not the same steroids athletes take to build up muscle)",
"       </li>",
"       <li>",
"        Antibiotics (if an infection is causing the pericarditis)",
"       </li>",
"       <li>",
"        Draining extra fluid from around the heart &ndash; Doctors do this with a thin needle.",
"       </li>",
"       <li>",
"        Rest",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your child needs more treatment, the doctor can do surgery to remove swollen, irritated tissue from around the heart.",
"     </p>",
"     <p>",
"      If doctors do not already know what is causing your child&rsquo;s pericarditis, they will look for the cause and treat it, if possible. This can help the pericarditis.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H101390623\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
