var title_f10_56_11149="Staging of cutaneous lymphoma other than MF SS";
var content_f10_56_11149=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F65110&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F65110&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ISCL/EORTC proposal on TNM classification of cutaneous lymphoma other than mycosis fungoides or S&eacute;zary syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        T",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        T1: Solitary skin involvement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        T1a: A solitary lesion &lt;5 cm diameter",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        T1b: A solitary lesion &gt;5 cm diameter",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        T2: Regional skin involvement: multiple lesions limited to&nbsp;one body region or&nbsp;two contiguous body regions*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        T2a: All-disease-encompassed in a &lt;15 cm-diameter circular area",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        T2b: All-disease-encompassed in a &gt;15 cm-&nbsp;and &lt;30 cm-diameter circular area",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        T2c: All-disease-encompassed in a &gt;30 cm-diameter circular area",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        T3: Generalized skin involvement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        T3a: Multiple lesions involving&nbsp;two noncontiguous body regions*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        T3b: Multiple lesions involving &ge;3 body regions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        N",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N0: No clinical or pathologic lymph node involvement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N1: Involvement of&nbsp;one peripheral lymph node region that drains an area of current or prior skin involvement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N2: Involvement of&nbsp;two or more peripheral lymph node regions or involvement of any lymph node region",
"        <sup>",
"         &bull;",
"        </sup>",
"        that does not drain an area of current or prior skin involvement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N3: Involvement of central lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        M",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M0: No evidence of extracutaneous non-lymph node disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M1: Extracutaneous non-lymph node disease present",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Definition of body regions:",
"     <br>",
"      - Head and neck: inferior border- superior border of clavicles, T1 spinous process.",
"      <br>",
"       - Chest: superior border- superior border of clavicles; inferior border- inferior margin of rib cage; lateral borders- mid-axillary lines, glenohumeral joints (inclusive of axillae).",
"       <br>",
"        - Abdomen/genital: superior border- inferior margin of rib cage; inferior border- inguinal folds, anterior perineum; lateral borders- mid-axillary lines.",
"        <br>",
"         - Upper back: superior border- T1 spinous process; inferior border- inferior margin of rib cage; lateral borders- mid-axillary lines.",
"         <br>",
"          - Lower back/buttocks: superior border- inferior margin of rib cage; inferior border- inferior gluteal fold, anterior perineum (inclusive of perineum); lateral borders- mid-axillary lines.",
"          <br>",
"           - Each upper arm: superior borders- glenohumeral joints (exclusive of axillae); inferior borders- ulnar/radial-humeral (elbow) joint.",
"           <br>",
"            - Each lower arm/hand: superior borders- ulnar/radial-humeral (elbow) joint.",
"            <br>",
"             - Each upper leg (thigh): superior borders- inguinal folds, inferior gluteal folds; inferior borders- mid-patellae, mid-popliteal fossae.",
"             <br>",
"              - Each lower leg/foot: superior borders- mid-patellae, mid-popliteal fossae.",
"              <br>",
"               <font class=\"bullet\">",
"                <sup>",
"                 &bull;",
"                </sup>",
"               </font>",
"               Definition of lymph node regions is consistent with the Ann Arbor system: Peripheral sites: antecubital, cervical, supraclavicular, axillary, inguinal-femoral, and popliteal. Central sites: mediastinal, pulmonary hilar, paraortic, iliac.",
"              </br>",
"             </br>",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     This research was originally published in Blood. Kim YH, Willemze R, Pimpinelli N, et al. TNM classification system for primary cutaneous lymphomas other than mycosis fungoides and Sezary syndrome: a proposal of the International Society for Cutaneous Lymphomas (ISCL) and the Cutaneous Lymphoma Task Force of the European Organization of Research and Treatment of Cancer (EORTC). Blood 2007; 110:479.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
